import React from "react";
import { Card, Avatar, Button } from "antd";

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="twit">0</div>,
        <div key="followings">0</div>,
        <div key="twit">0</div>,
      ]}
    >
      <Card.Meta title="Hyoil" avatar={<Avatar>Hyoil</Avatar>} />
      <Button>LogOut</Button>
    </Card>
  );
};

export default UserProfile;
